import React from "react";
import { Link } from "react-router-dom";

export default function Card({ image, name, temperament, weight }) {
  return (
    <div>
      <Link to={"/dogs/"}>
        <img className="card_image" src={image} alt="img not found" />
      </Link>
      <h3>{name}</h3>
      <h5>{temperament}</h5>
      <h5>{weight}</h5>
    </div>
  );
}
